The '''Dark Chest''' is a chest in the basement of the [[Crumbling Tower]] on the [[Isle of Souls]]. It can be opened with a [[dark key]] for 1,500 [[Thieving]] experience, which uses up the key.

It is possible to take 10 damage while opening the chest.

==Thieving info==
{{Thieving info
|name = Dark Chest
|level =28 
|xp = 1500
|type = Chest
|tool = [[Dark key]]
}}
Thieving from this chest requires level 28 [[Thieving]], the same as the [[Chest (Isle of Souls Dungeon)|Isle of Souls Dungeon chest]]. If your thieving level drops below 28, such as through stat-draining environments, you will receive the message, "You need a Thieving level of 28 to be able to open this chest."

